import { Outlet, useNavigation } from "react-router-dom";
import MainNavigation from '../components/MainNavigation'

export default function RootPage() {
    const navigation = useNavigation();

    navigation.state === 'loading';
    
    return <>
    <MainNavigation />
    <Outlet />
    </>
}
